	'By adjusting the starting position of the gradient, you can control how quickly or slowly each color transitions, and where the transition begins.' => 'A színátmenet kezdőpozíciójának beállításával szabályozhatja, milyen gyorsan vagy lassan vált minden egyes szín, és hol kezdődik az átmenet.',
	'By default comments are not placed on pages, however, if you would like to allow people to comment on your pages simply enable this option. ' => 'Alapértelmezés szerint az oldalakhoz nincsenek hozzászólások, azonban ha engedélyezni szeretné a hozzászólásokat az oldalakon, egyszerűen kapcsolja be ezt az opciót. ',
	'By default pages are sorted by name. However if you would rather have them sorted by ID you can adjust this setting.' => 'Alapértelmezés szerint az oldalak név szerint vannak rendezve. Ha inkább azonosító szerint szeretné őket rendezni, módosíthatja ezt a beállítást.',
	'By default the navigation bar stays on top of the screen at all times. We suggest to disable this option, if you need to use a logo taller than the default one.' => 'Alapértelmezés szerint a navigációs sáv mindig a képernyő tetején marad. Javasoljuk, hogy tiltsa le ezt az opciót, ha az alapértelmezettnél magasabb logót kell használnia.',
	'By default the theme creates a Home link that, when clicked, leads back to your blog\'s homepage. If, however, you are using a static homepage and have already created a page called Home to use, this will result in a duplicate link. In this case you should disable this feature to remove the link.' => 'Alapértelmezés szerint a téma létrehoz egy Kezdőlap hivatkozást, amelyre kattintva visszajut a blog kezdőoldalára. Ha azonban statikus kezdőoldalt használ, és már létrehozott egy Kezdőlap nevű oldalt, ez dupla hivatkozást eredményez. Ebben az esetben tiltsa le ezt a funkciót a hivatkozás eltávolításához.',
	'By default the theme creates post titles based on the title of your post and your blog name. If you would like to make your meta title different than your actual post title you can define a custom title for each post using custom fields. This option must be enabled for custom titles to work, and you must choose a custom field name for your title below.' => 'Alapértelmezés szerint a téma a bejegyzés címe és a blog neve alapján hoz létre bejegyzéscímeket. Ha a metacímet eltérővé szeretné tenni a tényleges bejegyzéscímtől, egyéni mezők használatával minden bejegyzéshez megadhat egyedi címet. Ehhez engedélyezni kell ezt az opciót, és alább meg kell adnia az egyéni mező nevét a címhez.',
	'By default the theme does not add keywords to your header. Most search engines don\'t use keywords to rank your site anymore, but some people define them anyway just in case. If you want to add meta keywords to your header then enable this option and fill in the custom keywords field below. ' => 'Alapértelmezés szerint a téma nem ad kulcsszavakat a fejlécbe. A legtöbb kereső már nem használ kulcsszavakat a rangsoroláshoz, de egyesek mégis megadják őket, biztos ami biztos. Ha meta kulcsszavakat szeretne hozzáadni a fejléchez, engedélyezze ezt az opciót, és töltse ki az alábbi egyéni kulcsszavak mezőt. ',
	'By default the theme truncates your posts on index/homepages automatically to create post previews. If you would rather show your posts in full on index pages like a traditional blog then you can activate this feature.' => 'Alapértelmezés szerint a téma automatikusan csonkítja a bejegyzéseket az index/kezdőoldalakon az előnézetek létrehozásához. Ha inkább teljes terjedelmükben szeretné megjeleníteni a bejegyzéseket az index oldalakon, mint egy hagyományos blogon, akkor aktiválhatja ezt a funkciót.',
	'By default the theme uses a combination of your blog name and your blog description, as defined when you created your blog, to create your homepage titles. However if you want to create a custom title then simply enable this option and fill in the custom title field below. ' => 'Alapértelmezés szerint a téma a blog neve és leírása (a blog létrehozásakor megadva) kombinációját használja a kezdőoldal címének létrehozásához. Ha azonban egyéni címet szeretne, egyszerűen engedélyezze ezt az opciót, és töltse ki az alábbi egyéni cím mezőt. ',
	'By default the theme uses your blog description, as defined when you created your blog, to fill in the meta description field. If you would like to use a different description then enable this option and fill in the custom description field below. ' => 'Alapértelmezés szerint a téma a blog leírását (a blog létrehozásakor megadva) használja a meta leírás mező kitöltéséhez. Ha más leírást szeretne használni, engedélyezze ezt az opciót, és töltse ki az alábbi egyéni leírás mezőt. ',
	'By default thumbnail images are created using custom fields. However, if you would rather use the images that are already in your post for your thumbnail (and bypass using custom fields) you can activate this option. Once activated thumbnail images will be generated automatically using the first image in your post. The image must be hosted on your own server.' => 'Alapértelmezés szerint a bélyegképek egyéni mezők alapján jönnek létre. Ha azonban inkább a bejegyzésben már szereplő képeket használná bélyegképként (és kihagyná az egyéni mezők használatát), aktiválhatja ezt az opciót. Aktiválás után a rendszer automatikusan a bejegyzés első képéből generál bélyegképet. A képnek a saját szerverén kell lennie.',
	'By default thumbnails are not placed on pages (they are only used on posts). However, if you want to use thumbnails on pages you can! Just enable this option. ' => 'Alapértelmezés szerint az oldalakon nincsenek bélyegképek (csak bejegyzéseknél használatosak). Ha azonban az oldalakon is szeretne bélyegképeket használni, megteheti! Csak engedélyezze ezt az opciót. ',
	'By default thumbnails are placed at the beginning of your post on single post pages. If you would like to remove this initial thumbnail image to avoid repetition simply disable this option. ' => 'Alapértelmezés szerint az egyedi bejegyzésoldalakon a bejegyzés elején jelenik meg a bélyegkép. Ha el szeretné távolítani ezt a kezdő bélyegképet az ismétlődés elkerülése érdekében, egyszerűen tiltsa le ezt az opciót. ',
	'By default, animations will only play once. If you would like to loop your animation continuously you can choose the Loop option here.' => 'Alapértelmezés szerint az animációk csak egyszer játszódnak le. Ha folyamatosan szeretné ismételni az animációt, válassza itt az Ismétlés opciót.',
	'By default, button icons are displayed on hover. If you would like button icons to always be displayed, then you can enable this option.' => 'Alapértelmezés szerint a gombikonok csak egér fölé húzásakor jelennek meg. Ha azt szeretné, hogy a gombikonok mindig láthatók legyenek, engedélyezze ezt az opciót.',
	'By default, elements will extend the full width of their parent element. If you would like to set a custom static width, you can do so using this option.' => 'Alapértelmezés szerint az elemek a szülőelem teljes szélességét kitöltik. Ha egyéni, statikus szélességet szeretne megadni, ezt ezzel az opcióval teheti meg.',
	'By default, memory limits set by your host or by WordPress may be too low. This will lead to applications crashing as PHP reaches the artificial limit. You can adjust your memory limit within your <a href="%1$s" target="_blank">php.ini file</a>, or by contacting your host for assistance. You may also need to define a memory limited in <a href="%2$s" target=_blank">wp-config.php</a>.' => 'Alapértelmezés szerint a tárhelyszolgáltató vagy a WordPress által beállított memóriakorlátok túl alacsonyak lehetnek. Ez ahhoz vezethet, hogy az alkalmazások összeomlanak, amikor a PHP eléri a mesterséges korlátot. A memóriakorlátot módosíthatja a <a href="%1$s" target="_blank">php.ini fájlban</a>, vagy segítségért felveheti a kapcsolatot a tárhelyszolgáltatójával. Szükség lehet memóriakorlát megadására a <a href="%2$s" target=_blank">wp-config.php</a> fájlban is.',
	'By default, the Divi Builder is only accessible on standard post types. This option lets you enable the builder on any custom post type currently registered on your website, however the builder may not be compatible with all custom post types.' => 'Alapértelmezés szerint a Divi Builder csak a szabványos bejegyzéstípusokon érhető el. Ez az opció lehetővé teszi a Builder engedélyezését a webhelyen jelenleg regisztrált bármely egyéni bejegyzéstípuson, azonban a Builder nem feltétlenül kompatibilis minden egyéni bejegyzéstípussal.',
	'By default, values will only be replaced when found within the exact option type selected. If you enable this checkbox, the search will be extended to all options and values will be replaced everywhere. For example, a color will be replaced in all colors options: Text Colors, Background Colors, Border Colors, etc.' => 'Alapértelmezés szerint az értékek csak akkor kerülnek cserére, ha a kiválasztott pontos beállítástípuson belül találhatók. Ha engedélyezi ezt a jelölőnégyzetet, a keresés minden beállításra kiterjed, és az értékek mindenhol cserélve lesznek. Például egy szín minden vonatkozó beállításban cserére kerül: szövegszínek, háttérszínek, szegélyszínek stb.',
	'By increasing the starting opacity, you can reduce or remove the fade effect that is applied to all animation styles.' => 'A kezdő átlátszatlanság növelésével csökkentheti vagy eltávolíthatja az összes animációs stílusra alkalmazott elhalványulási effektust.',
