	'Confirm' => 'Megerősítés',
	'Congratulations! This site is 100% compatible with Divi 5. You can migrate your site to Divi 5 to take advantage of the new builder and front end page speeds. Don\'t forget to back up your website before migrating.' => 'Gratulálunk! Ez a webhely 100%-ban kompatibilis a Divi 5-tel. Átmigrálhatja webhelyét a Divi 5-re, hogy kihasználja az új szerkesztőt és a gyorsabb felhasználói oldali oldalsebességet. Ne felejtse el biztonsági mentést készíteni a webhelyéről a migrálás előtt.',
	'Congratulations! You migrated your website to the Divi 5 framework. You can return to this page anytime to run a new compatibility check to see if additional modules are ready for conversion or to convert any recently imported content. Throughout the beta process, new modules, such as Woo modules and modules from the Divi Marketplace, may be updated to support Divi 5. At this point, you can convert them using the migrator. Most third-party modules will not be ready for conversion at this early stage.' => 'Gratulálunk! A webhelyét átmigrálta a Divi 5 keretrendszerre. Bármikor visszatérhet erre az oldalra, hogy új kompatibilitás-ellenőrzést futtasson, és megnézze, hogy további modulok készen állnak-e az átalakításra, illetve hogy átalakítsa a nemrég importált tartalmakat. A béta időszak során új modulok, például Woo modulok és a Divi Marketplace moduljai frissülhetnek a Divi 5 támogatására. Ekkor ezeket a migrátor segítségével átalakíthatja. A legtöbb harmadik féltől származó modul ebben a korai szakaszban még nem lesz kész az átalakításra.',
	'Congratulations, all system checks have passed. Your hosting configuration is compatible with Divi.' => 'Gratulálunk, az összes rendszerellenőrzés sikeres. A tárhelykonfiguráció kompatibilis a Divi-vel.',
	'Congratulations, you have selected a split testing subject! Next you need to select your goal. After closing this window, please click the section, row or module that you want to use as your goal. Depending on the element you choose, Divi will track relevant conversion rates for clicks, reads or sales. For example, if you select a Call To Action module as your goal, then Divi will track how variations in your test subjects affect how often visitors read and click the button in your Call To Action module. The test subject itself can also be selected as your goal.' => 'Gratulálunk, kiválasztotta az A/B teszt tárgyát! Következő lépésként válassza ki a célját. Az ablak bezárása után kattintson arra a szekcióra, sorra vagy modulra, amelyet célként szeretne használni. A választott elemtől függően a Divi a releváns konverziós arányokat fogja követni kattintásokra, olvasásokra vagy értékesítésekre vonatkozóan. Például ha egy Call To Action modult választ célként, a Divi követni fogja, hogy a tesztelt elem változatai hogyan befolyásolják, milyen gyakran olvassák el és kattintanak a gombra a Call To Action modulban. Magát a tesztelt elemet is kiválaszthatja célként.',
	'Congratulations, your split test is ready to go! You will notice that your split testing subject has been duplicated. Each split testing variation will be displayed to your visitors and statistics will be collected to figure out which variation results in the highest goal conversion rate. Your test will begin when you save this page.' => 'Gratulálunk, az A/B teszt készen áll! Észre fogja venni, hogy az A/B teszt tárgya duplikálva lett. Az A/B teszt minden változata megjelenik a látogatók számára, és statisztikák gyűlnek arról, melyik változat eredményezi a legmagasabb célkonverziós arányt. A teszt az oldal mentésekor indul el.',
