	'Here you can define the Date Format in Post Meta. Default is \'M j, Y\'' => 'Itt megadhatja a dátumformátumot a bejegyzés metaadataiban. Alapértelmezett: \'M j, Y\'',
	'Here you can define the alignment of Button' => 'Itt megadhatja a gomb igazítását',
	'Here you can define the content that will be placed within the current tab.' => 'Itt megadhatja az aktuális fülbe kerülő tartalmat.',
	'Here you can define the content that will be placed within the infobox for the pin.' => 'Itt megadhatja a jelölő információs dobozába kerülő tartalmat.',
	'Here you can define the custom pattern for the email Message. Fields should be included in following format - <strong>%%field_id%%</strong>. For example if you want to include the field with id = <strong>phone</strong> and field with id = <strong>message</strong>, then you can use the following pattern: <strong>My message is %%message%% and phone number is %%phone%%</strong>. Leave blank for default.' => 'Itt megadhatja az e-mail üzenet egyéni mintáját. A mezőket a következő formátumban kell megadni - <strong>%%field_id%%</strong>. Például ha fel szeretné venni a <strong>phone</strong> és a <strong>message</strong> azonosítójú mezőket, akkor a következő mintát használhatja: <strong>My message is %%message%% and phone number is %%phone%%</strong>. Alapértelmezett esetén hagyja üresen.',
	'Here you can define whether previous and next posts must be within the same taxonomy term as the current post' => 'Itt megadhatja, hogy az előző és következő bejegyzéseknek az aktuális bejegyzéssel azonos taxonómia-kifejezésbe kell-e tartozniuk',
	'Here you can define whether to show "read more" link after the excerpts or not.' => 'Itt megadhatja, hogy megjelenjen-e a "bővebben" link a kivonatok után.',
	'Here you can designate how fast the carousel rotates, if \'Automatic Carousel Rotation\' option is enabled above. The higher the number the longer the pause between each rotation. (Ex. 1000 = 1 sec)' => 'Itt beállíthatja, milyen gyorsan forog a karusszel, ha fentebb engedélyezve van az \'Automatic Carousel Rotation\' opció. Minél nagyobb a szám, annál hosszabb a szünet az egyes forgások között. (Pl. 1000 = 1 mp)',
	'Here you can designate how fast the slider fades between each slide, if \'Automatic Animation\' option is enabled above. The higher the number the longer the pause between each rotation.' => 'Itt beállíthatja, milyen gyorsan halványul át a csúszka az egyes diák között, ha fentebb engedélyezve van az \'Automatic Animation\' opció. Minél nagyobb a szám, annál hosszabb a szünet az egyes váltások között.',
	'Here you can designate how many WooCommerce products are displayed on the archive page. This option works independently from the Settings > Reading options in wp-admin.' => 'Itt megadhatja, hány WooCommerce termék jelenjen meg az archívum oldalon. Ez a beállítás független a Beállítások > Olvasás opcióktól a wp-adminban.',
	'Here you can designate how many recent articles are displayed on the Archive pages. This option works independently from the Settings > Reading options in wp-admin.' => 'Itt megadhatja, hány legutóbbi cikk jelenjen meg az archívum oldalakon. Ez a beállítás független a Beállítások > Olvasás opcióktól a wp-adminban.',
	'Here you can designate how many recent articles are displayed on the Category page. This option works independently from the Settings > Reading options in wp-admin.' => 'Itt megadhatja, hány legutóbbi cikk jelenjen meg a kategória oldalon. Ez a beállítás független a Beállítások > Olvasás opcióktól a wp-adminban.',
	'Here you can designate how many recent articles are displayed on the Search results pages. This option works independently from the Settings > Reading options in wp-admin.' => 'Itt megadhatja, hány legutóbbi cikk jelenjen meg a keresési találatok oldalain. Ez a beállítás független a Beállítások > Olvasás opcióktól a wp-adminban.',
	'Here you can designate how many recent articles are displayed on the Tag pages. This option works independently from the Settings > Reading options in wp-admin.' => 'Itt megadhatja, hány legutóbbi cikk jelenjen meg a címke oldalakon. Ez a beállítás független a Beállítások > Olvasás opcióktól a wp-adminban.',
	'Here you can disable automatic memory limit increase.' => 'Itt letilthatja az automatikus memóriakorlát-növelést.',
