	'Here you can provide 468x60 banner destination url' => 'Itt megadhatja a 468x60-as banner cél URL-jét',
	'Here you can provide 468x60 banner image url' => 'Itt megadhatja a 468x60-as banner kép URL-jét',
	'Here you can save the current item and add it to your Divi Library for later use as well.' => 'Itt elmentheti az aktuális elemet, és későbbi használatra hozzáadhatja a Divi Library-hez is.',
	'Here you can see a list of pre-made layout packs that ship with the Divi Builder. You can also access layouts that you have saved to your Divi Library. Choose the “Divi Builder Demo” layout pack to see the layouts it includes.' => 'Itt megtekintheti a Divi Builderrel érkező, előre elkészített elrendezéscsomagok listáját. Hozzáférhet a saját, Divi Library-be mentett elrendezéseihez is. Válassza a “Divi Builder Demo” elrendezéscsomagot, hogy megnézze, milyen elrendezéseket tartalmaz.',
	'Here you can select the Page type.' => 'Itt kiválaszthatja az oldal típusát.',
