	'Here you can select the tabs that you would like to display.' => 'Itt kiválaszthatja a megjeleníteni kívánt füleket.',
	'Here you can select whether or not your section has an inner shadow. This can look great when you have colored backgrounds or background images.' => 'Itt kiválaszthatja, hogy legyen-e belső árnyéka a szakasznak. Ez különösen jól mutat színes hátterek vagy háttérképek esetén.',
	'Here you can set the Breadcrumb separator.' => 'Itt beállíthatja a morzsamenü elválasztóját.',
