	'If a page is built with the Divi Builder, the Gutenberg block CSS file is moved from the header to the footer. Since the file is most likely not used, we can load it later. This removes a render blocking request and improving performance.' => 'Ha egy oldal a Divi Builderrel készült, a Gutenberg blokk CSS fájl a fejlécből a láblécbe kerül. Mivel a fájl nagy valószínűséggel nem használt, később tölthetjük be. Ez megszüntet egy renderelést blokkoló kérést, és javítja a teljesítményt.',
	'If custom titles are disabled, choose autogeneration method' => 'Ha az egyéni címek le vannak tiltva, válassza ki az automatikus generálás módját',
	'If defined, this element will stick to the bottom of this container, overriding its stickiness to the edge of the browser' => 'Ha meg van adva, ez az elem a konténer aljához rögzül, felülbírálva a böngésző széleihez való tapadását',
	'If defined, this element will stick to the top of this container, overriding its stickiness edge of the browser' => 'Ha meg van adva, ez az elem a konténer tetejéhez rögzül, felülbírálva a böngésző széléhez való tapadását',
	'If defined, this image will be used as the background for this module. To remove a background image, simply delete the URL from the settings field.' => 'Ha meg van adva, ez a kép lesz a modul háttérképe. A háttérkép eltávolításához egyszerűen törölje az URL-t a beállítások mezőből.',
	'If defined, this slide image will appear to the left of your slide text. Upload an image, or leave blank for a text-only slide.' => 'Ha meg van adva, ez a diakép a dia szövegének bal oldalán jelenik meg. Töltsön fel egy képet, vagy hagyja üresen csak szöveges diához.',
	'If defined, this video will appear to the left of your slide text. Enter youtube or vimeo page url, or leave blank for a text-only slide.' => 'Ha meg van adva, ez a videó a dia szövegének bal oldalán jelenik meg. Adja meg a youtube vagy vimeo oldal url címét, vagy hagyja üresen csak szöveges diához.',
	'If enabled Product Tour will be started automatically when Visual Builder launched for the first time' => 'Ha engedélyezve van, a Product Tour automatikusan elindul, amikor a Visual Buildert először elindítja',
	'If enabled, an overlay color and icon will be displayed when a visitors hovers over the featured image of a post.' => 'Ha engedélyezve van, fedőszín és ikon jelenik meg, amikor a látogató az egérrel a bejegyzés kiemelt képére húzza a kurzort.',
	'If enabled, an overlay color and icon will be displayed when a visitors hovers over the image' => 'Ha engedélyezve van, fedőszín és ikon jelenik meg, amikor a látogató az egérrel a képre húzza a kurzort',
	'If enabled, defined gradient stops will be repeated until the outer boundary of the background is reached.' => 'Ha engedélyezve van, a meghatározott színátmenet-megállópontok ismétlődnek, amíg el nem érik a háttér külső határát.',
	'If enabled, gradient will be positioned on top of background-image' => 'Ha engedélyezve van, a színátmenet a background-image fölé kerül',
	'If enabled, the check mark will be automatically selected for the visitor. They can still deselect it.' => 'Ha engedélyezve van, a jelölőnégyzet automatikusan be lesz jelölve a látogató számára. Ettől még törölhetik a jelölést.',
	'If enabled, the check mark will be automatically selected for the visitor. They can still deselected it.' => 'Ha engedélyezve van, a jelölőnégyzet automatikusan be lesz jelölve a látogató számára. Ettől még törölhetik a jelölést.',
	'If enabled, the field will take 100% of the width of the content area, otherwise it will take 50%' => 'Ha engedélyezve van, a mező a tartalomterület szélességének 100%-át foglalja el, ellenkező esetben 50%-át',
	'If enabled, the field will take 100% of the width of the form, otherwise it will take 50%' => 'Ha engedélyezve van, a mező az űrlap szélességének 100%-át foglalja el, ellenkező esetben 50%-át',
	'If enabled, your background image will stay fixed as your scroll, creating a fun parallax-like effect.' => 'Ha engedélyezve van, a háttérkép görgetés közben rögzítve marad, parallax-szerű hatást keltve.',
	'If the background image is smaller than the size of the element, you may want the image to repeat. This result will result in a background image pattern.' => 'Ha a háttérkép kisebb, mint az elem mérete, előfordulhat, hogy ismételtetni szeretné a képet. Ez háttérképmintát eredményez.',
	'If this option appears to have no effect, you might need to' => 'Ha úgy tűnik, hogy ez az opció nem hat, szükség lehet rá, hogy',
	'If this website contains content built with Divi 4, you can use the migrator to convert your website to the Divi 5 format. Un-migrated content will not benefit from Divi 5 performance improvements.' => 'Ha ez a webhely Divi 4-gyel készült tartalmat tartalmaz, a migráló eszközzel átalakíthatja webhelyét Divi 5 formátumra. A nem migrált tartalom nem részesül a Divi 5 teljesítményjavításaiból.',
	'If you are not using cutsom post titles you can still have control over how your titles are generated. Here you can choose which order you would like your post title and blog name to be displayed, or you can remove the blog name from the title completely.' => 'Ha nem használ egyéni bejegyzéscímeket, továbbra is szabályozhatja, hogyan generálódjanak a címek. Itt kiválaszthatja, milyen sorrendben jelenjen meg a bejegyzés címe és a blog neve, vagy teljesen eltávolíthatja a blog nevét a címből.',
	'If you are not using cutsom post titles you can still have control over hw your titles are generated. Here you can choose which order you would like your post title and blog name to be displayed, or you can remove the blog name from the title completely.' => 'Ha nem használ egyéni bejegyzéscímeket, továbbra is szabályozhatja, hogyan generálódjanak a címek. Itt kiválaszthatja, milyen sorrendben jelenjen meg a bejegyzés címe és a blog neve, vagy teljesen eltávolíthatja a blog nevét a címből.',
	'If you are using a caching plugin, This page should be excluded from the cache to allow the conditions you have selected to function properly.' => 'Ha gyorsítótárazó bővítményt használ, ezt az oldalt ki kell zárni a gyorsítótárból, hogy a kiválasztott feltételek megfelelően működjenek.',
	'If you don\'t want to display some banners - leave approptiate fields blank' => 'Ha nem szeretne bizonyos bannereket megjeleníteni - hagyja üresen a megfelelő mezőket',
	'If you have a slide image defined, input your HTML ALT text for the image here.' => 'Ha meg van adva diakép, itt adja meg a kép HTML ALT szövegét.',
	'If you have cleared your plugin cache and browser cache, but still get this warning, then your files may be cached at the DNS or Server level. Contact your host or CDN for assistance.' => 'Ha törölte a bővítmény és a böngésző gyorsítótárát, de továbbra is megkapja ezt a figyelmeztetést, előfordulhat, hogy a fájlok DNS- vagy szerver szinten vannak gyorsítótárazva. Segítségért lépjen kapcsolatba a tárhelyszolgáltatójával vagy a CDN-nel.',
	'If you have enabled custom titles you can add your custom title here. Whatever you type here will be placed between the < title >< /title > tags in header.php' => 'Ha engedélyezte az egyéni címeket, itt adhatja meg az egyéni címet. Amit ide beír, az a header.php fájlban a < title >< /title > tagek közé kerül.',
	'If you have enabled meta descriptions you can add your custom description here.' => 'Ha engedélyezte a meta leírásokat, itt adhatja meg az egyéni leírást.',
	'If you have enabled meta keywords you can add your custom keywords here. Keywords should be separated by comas. For example: wordpress,themes,templates,elegant' => 'Ha engedélyezte a meta kulcsszavakat, itt adhatja meg az egyéni kulcsszavakat. A kulcsszavakat vesszővel válassza el. Például: wordpress,themes,templates,elegant',
	'If you have shopped with us before, please enter your details below. If you are a new customer, please proceed to the Billing section.' => 'Ha már vásárolt nálunk, adja meg lentebb az adatait. Ha új vásárló, kérjük, lépjen tovább a Számlázás részhez.',
	'If you recently updated to a new version and are experiencing problems, you can easily roll back to the previously-installed version. We always recommend using the latest version and testing updates on a staging site. However, if you run into problems after updating you always have the option to roll back.' => 'Ha nemrég frissített új verzióra, és problémákat tapasztal, könnyen visszaállhat az előzőleg telepített verzióra. Mindig azt javasoljuk, hogy a legújabb verziót használja, és a frissítéseket tesztkörnyezetben próbálja ki. Ha azonban frissítés után problémák merülnek fel, mindig lehetősége van visszaállni.',
	'If you the carousel layout option is chosen and you would like the carousel to slide automatically, without the visitor having to click the next button, enable this option and then adjust the rotation speed below if desired.' => 'Ha a körhinta elrendezést választotta, és szeretné, hogy a körhinta automatikusan váltson anélkül, hogy a látogatónak a Tovább gombra kellene kattintania, engedélyezze ezt az opciót, majd igény szerint állítsa be lent a váltási sebességet.',
	'If you would like categories to be displayed in your navigationbar that don\'t have any posts in them then disable this option. By default empty categories are hidden' => 'Ha azt szeretné, hogy a navigációs sávban olyan kategóriák is megjelenjenek, amelyekben nincs bejegyzés, tiltsa le ezt az opciót. Alapértelmezés szerint az üres kategóriák rejtve vannak.',
	'If you would like the slider to slide automatically, without the visitor having to click the next button, enable this option and then adjust the rotation speed below if desired.' => 'Ha szeretné, hogy a slider automatikusan váltson anélkül, hogy a látogatónak a Tovább gombra kellene kattintania, engedélyezze ezt az opciót, majd igény szerint állítsa be alább a váltási sebességet.',
	'If you would like to add a delay before your animation runs you can designate that delay here in milliseconds. This can be useful when using multiple animated modules together.' => 'Ha késleltetést szeretne hozzáadni az animáció futtatása előtt, itt adhatja meg a késleltetést milliszekundumban. Ez hasznos lehet több animált modul együttes használatakor.',
	'If you would like to add a meta description to your post you can do so using custom fields. This option must be enabled for descriptions to be displayed on post pages. You can add your meta description using custom fields based off the custom field name you define below.' => 'Ha meta leírást szeretne hozzáadni a bejegyzéséhez, ezt egyéni mezők használatával teheti meg. Ennek az opciónak engedélyezve kell lennie, hogy a leírások megjelenjenek a bejegyzésoldalakon. Az alább megadott egyéni mezőnév alapján egyéni mezőkben adhatja meg a meta leírást.',
	'If you would like to add meta keywords to your post you can do so using custom fields. This option must be enabled for keywords to be displayed on post pages. You can add your meta keywords using custom fields based off the custom field name you define below.' => 'Ha meta kulcsszavakat szeretne hozzáadni a bejegyzéséhez, ezt egyéni mezők használatával teheti meg. Ennek az opciónak engedélyezve kell lennie, hogy a kulcsszavak megjelenjenek a bejegyzésoldalakon. Az alább megadott egyéni mezőnév alapján egyéni mezőkben adhatja meg a meta kulcsszavakat.',
	'If you would like to adjust the date format, input the appropriate PHP date format here.' => 'Ha módosítani szeretné a dátumformátumot, ide írja be a megfelelő PHP dátumformátumot.',
	'If you would like to control the size of the icon, you must first enable this option.' => 'Ha az ikon méretét szeretné szabályozni, először engedélyeznie kell ezt az opciót.',
	'If you would like to customize the appearance of this module\'s button, you must first enable custom button styles.' => 'Ha testre szeretné szabni ennek a modulnak a gombját, először engedélyeznie kell az egyéni gombstílusokat.',
	'If you would like to make your blurb a link, input your destination URL here.' => 'Ha a blurb elemet linkké szeretné tenni, ide írja be a cél URL-t.',
	'If you would like to make your logo a link, input your destination URL here.' => 'Ha a logót linkké szeretné tenni, ide írja be a cél URL-t.',
	'If you would like to remove the dropdown menus from the categories navigation bar disable this feature.' => 'Ha el szeretné távolítani a lenyíló menüket a kategóriák navigációs sávjáról, tiltsa le ezt a funkciót.',
