	'The Divi Builder does not support the browser you are using. Your browser is no longer being developed, so it is time to switch to something new! The Divi Builder works best in the most recent versions of Chrome, Firefox, Safari, Opera and Edge.' => 'A Divi Builder nem támogatja az Ön által használt böngészőt. A böngészőjét már nem fejlesztik, ezért ideje egy új böngészőre váltani! A Divi Builder a Chrome, Firefox, Safari, Opera és Edge legfrissebb verzióiban működik a legjobban.',
