	'The following items are used on your website and are ready to be converted to the Divi 5 format.' => 'Az alábbi elemek használatban vannak a webhelyén, és készek a Divi 5 formátumra való átalakításra.',
	'The following plugins will be temporarily disabled for you only:' => 'A következő bővítmények ideiglenesen csak az Ön számára lesznek letiltva:',
