	'The higher the modification strength, the more power your prompt has to modify the original image. Reducing the strength will result in more minimal changes.' => 'Minél nagyobb a módosítási erősség, annál nagyobb hatása van a promptnak az eredeti kép módosítására. Az erősség csökkentése visszafogottabb változtatásokat eredményez.',
