	'This field contains a dynamic value which requires the Visual Builder. <a href="#" class="%1$s">Open Visual Builder</a>' => 'Ez a mező dinamikus értéket tartalmaz, amihez a Visual Builder szükséges. <a href="#" class="%1$s">Visual Builder megnyitása</a>',
	'This file cannot be imported. It may be caused by file_uploads being disabled in your php.ini. It may also be caused by post_max_size or/and upload_max_filesize being smaller than file selected. Please increase it or transfer more substantial data at the time.' => 'Ez a fájl nem importálható. Ennek oka lehet, hogy a file_uploads le van tiltva a php.ini fájlban. Oka lehet az is, hogy a post_max_size és/vagy az upload_max_filesize kisebb a kiválasztott fájlnál. Kérjük, növelje ezeket, vagy egyszerre nagyobb mennyiségű adatot továbbítson.',
