	'This global color will be deleted, and all instances across your site will be replaced with another global color of your choice.' => 'Ez a globális szín törlődik, és a webhelyen található összes előfordulás az Ön által választott másik globális színre lesz cserélve.',
	'This import contains references to the global Header, Body, and/or Footer from the website they were exported from. How would you like to import these references?' => 'Ez az import a globális Headerre, Bodyra és/vagy Footerre mutató hivatkozásokat tartalmaz abból a webhelyből, ahonnan exportálták. Hogyan szeretné importálni ezeket a hivatkozásokat?',
	'This is a child theme of %s.' => 'Ez a(z) %s gyermek témája.',
	'This is a very important performance setting that should be turned on. Critical CSS greatly improves website loading speeds by deferring "below the fold" styles and removing render blocking requests for critical styles. You can turn this setting on in the <a href="%1$s" target="_blank">Theme Options</a>.' => 'Ez egy nagyon fontos teljesítménybeállítás, amelyet be kell kapcsolni. A Critical CSS jelentősen javítja a webhely betöltési sebességét azzal, hogy késlelteti a "below the fold" stílusok betöltését és eltávolítja a kritikus stílusokra vonatkozó renderelést blokkoló kéréseket. Ezt a beállítást a <a href="%1$s" target="_blank">Theme Options</a> menüben kapcsolhatja be.',
	'This is a very important performance setting that should be turned on. The Dynamic Framework removes bloat from the back-end. This greatly reduces CPU and Memory usage and improves website speed. You can turn this setting on in the <a href="%1$s" target="_blank">Theme Options</a>.' => 'Ez egy nagyon fontos teljesítménybeállítás, amelyet be kell kapcsolni. A Dynamic Framework eltávolítja a felesleges terheket a backenden. Ez nagymértékben csökkenti a CPU- és memóriahasználatot, és javítja a webhely sebességét. Ezt a beállítást a <a href="%1$s" target="_blank">Theme Options</a> menüben kapcsolhatja be.',
