	'This is the option value that will be replaced throughout your page. Where this option exists, within the defined scope, it will be replaced by the new value configured below.' => 'Ez az az opcióérték, amely az oldal egészén lecserélésre kerül. Ahol ez az opció a meghatározott tartományon belül létezik, ott az alább beállított új értékre lesz cserélve.',
