	'This layout contains global design presets. Check the box below to import these styles as presets, or leave it unchecked to bring them in as static styles.' => 'Ez az elrendezés globális dizájn-előbeállításokat tartalmaz. Jelölje be az alábbi négyzetet, ha ezeket a stílusokat előbeállításként szeretné importálni, vagy hagyja üresen, hogy statikus stílusokként érkezzenek.',
