	'This row cannot be removed because it contains a split testing goal. Goals cannot be deleted. You must first end your split test before performing this action.' => 'Ezt a sort nem lehet eltávolítani, mert osztott teszt célját tartalmazza. A célok nem törölhetők. Előbb be kell fejeznie az osztott tesztet, mielőtt ezt a műveletet elvégzi.',
	'This section cannot be copied because it contains a split testing goal. Goals cannot be duplicated. You must first end your split test before performing this action.' => 'Ezt a szakaszt nem lehet másolni, mert osztott teszt célját tartalmazza. A célok nem duplikálhatók. Előbb be kell fejeznie az osztott tesztet, mielőtt ezt a műveletet elvégzi.',
	'This section cannot be duplicated because it contains a split testing goal. Goals cannot be duplicated. You must first end your split test before performing this action.' => 'Ezt a szakaszt nem lehet duplikálni, mert osztott teszt célját tartalmazza. A célok nem duplikálhatók. Előbb be kell fejeznie az osztott tesztet, mielőtt ezt a műveletet elvégzi.',
	'This section cannot be removed because it contains a split testing goal. Goals cannot be deleted. You must first end your split test before performing this action.' => 'Ezt a szakaszt nem lehet eltávolítani, mert osztott teszt célját tartalmazza. A célok nem törölhetők. Előbb be kell fejeznie az osztott tesztet, mielőtt ezt a műveletet elvégzi.',
	'This sets a static height value for your element. Once set, the height of the element will no longer be determined by its inner content. Content that exceeds the static height of the element will overflow the element wrapper.' => 'Ez statikus magasságértéket állít be az elemhez. Beállítás után az elem magasságát már nem a belső tartalma határozza meg. Az elem statikus magasságát meghaladó tartalom túl fog folyni az elem burkolatán.',
	'This sets the maximum time in seconds a script is allowed to parse input data. If the limit is too low, the Divi Builder may time out before it is allowed to load. You can adjust your max input time within your <a href="%1$s" target="_blank">php.ini file</a>, or by contacting your host for assistance.' => 'Ez beállítja azt a maximális időt másodpercben, ameddig egy szkript feldolgozhatja a bemeneti adatokat. Ha a korlát túl alacsony, a Divi Builder időtúlléphet, mielőtt betöltődhetne. A maximális input időt a <a href="%1$s" target="_blank">php.ini fájlban</a> módosíthatja, vagy kérjen segítséget a tárhelyszolgáltatótól.',
	'This setting adjusts the shape of the bullet point that begins each list item.' => 'Ez a beállítás a felsorolásjel alakját állítja be, amellyel minden listaelem kezdődik.',
	'This setting affects how many input variables may be accepted. If the limit is too low, it may prevent the Divi Builder from loading. You can adjust your max input variables within your <a href="%1$s" target="_blank">php.ini file</a>, or by contacting your host for assistance.' => 'Ez a beállítás befolyásolja, hány bemeneti változó fogadható el. Ha a korlát túl alacsony, megakadályozhatja a Divi Builder betöltődését. A max input variables értéket a <a href="%1$s" target="_blank">php.ini fájlban</a> módosíthatja, vagy kérjen segítséget a tárhelyszolgáltatótól.',
	'This setting allows you to turn the navigation arrows on or off.' => 'Ez a beállítás lehetővé teszi a navigációs nyilak be- vagy kikapcsolását.',
	'This setting determines the vertical alignment of your content. Your content can either be vertically centered, or aligned to the bottom.' => 'Ez a beállítás meghatározza a tartalom függőleges igazítását. A tartalom lehet függőlegesen középre igazítva vagy alulra igazítva.',
	'This setting determines the vertical alignment of your slide image. Your image can either be vertically centered, or aligned to the bottom of your slide.' => 'Ez a beállítás meghatározza a diakép függőleges igazítását. A kép lehet függőlegesen középre igazítva, vagy a dia aljához igazítva.',
	'This setting determines whether or not errors should be printed as part of the page output. This is a feature to support your site\'s development and should never be used on production sites. You can edit this setting within your <a href="%1$s" target="_blank">php.ini file</a>, or by contacting your host for assistance.' => 'Ez a beállítás meghatározza, hogy a hibák megjelenjenek-e az oldal kimenetében. Ez a funkció a webhely fejlesztését szolgálja, és éles webhelyen soha nem szabad használni. Ezt a beállítást a <a href="%1$s" target="_blank">php.ini fájlban</a> módosíthatja, vagy segítségért lépjen kapcsolatba a tárhelyszolgáltatójával.',
	'This setting will let you choose to use the thumbnail track controls below the slider or dot navigation at the bottom of the slider.' => 'Ez a beállítás lehetővé teszi, hogy a csúszka alatt lévő bélyegkép-sáv vezérlőit vagy a csúszka alján található pontnavigációt használja.',
	'This setting will make your slider arrows either light or dark in color.' => 'Ez a beállítás világos vagy sötét színűvé teszi a csúszka nyilait.',
	'This setting will make your slider controls either light or dark in color. Slider controls are either the arrows on the thumbnail track or the circles in dot navigation.' => 'Ez a beállítás világos vagy sötét színűvé teszi a csúszka vezérlőit. A csúszka vezérlői a bélyegkép-sáv nyilai vagy a pontnavigáció körei.',
