	'We recommend using the latest stable version of WordPress. This will not only ensure compatibility with Divi, but it will also greatly speed up your website leading to less memory and CPU related issues.' => 'Javasoljuk a WordPress legújabb stabil verziójának használatát. Ez nemcsak a Divivel való kompatibilitást biztosítja, hanem jelentősen fel is gyorsítja a webhelyét, csökkentve a memória- és CPU-val kapcsolatos problémákat.',
	'We want to provide exactly the level of support any of our customers need to be successful. With Divi VIP, you get faster support (Under 30 minutes response times around the clock). Keep your clients happy by letting us solve their problems faster.' => 'Pontosan azt a támogatási szintet szeretnénk nyújtani, amelyre bármely ügyfelünknek szüksége van a sikerhez. A Divi VIP-vel gyorsabb támogatást kap (a nap 24 órájában 30 percen belüli válaszidővel). Tartsa elégedetten ügyfeleit azzal, hogy gyorsabban megoldjuk a problémáikat.',
	'We want to provide the community with as much information as possible about the current state of Divi 5. We give monthly updates on our progress and cover various topics related to Divi 5.' => 'Szeretnénk a lehető legtöbb információt megosztani a közösséggel a Divi 5 jelenlegi állapotáról. Havonta frissítéseket adunk az előrehaladásunkról, és a Divi 5-tel kapcsolatos különféle témákat érintünk.',
	'We worked with our parters to make sure that their hosting solutions meet all of Divi\'s requirements out of the box. No hosting headaches on Divi Hosting.' => 'Partnereinkkel együttműködve biztosítottuk, hogy tárhelymegoldásaik alapértelmezetten megfeleljenek a Divi minden követelményének. A Divi Hostinggal nincs tárhelygond.',
