	'Welcome to Divi! Before diving in to your new theme, please visit the <a style="color: #fff; font-weight: bold;" href="%1$s" target="_blank">Divi Documentation</a> page for access to dozens of in-depth tutorials.' => 'Üdvözöljük a Diviben! Mielőtt belemerülne az új sablonba, kérjük, látogassa meg a <a style="color: #fff; font-weight: bold;" href="%1$s" target="_blank">Divi Documentation</a> oldalt, ahol több tucat mélyreható oktatóanyagot talál.',
