	'What would you like to create using custom code?' => 'Mit szeretne létrehozni egyéni kóddal?',
	'WhatsApp' => 'WhatsApp',
	'When Critical CSS is enabled, Divi determines an "above the fold threshold" and defers all styles for elements below the fold. However, this threshold is just a estimate and can vary on different devices. Increasing threshold height will deffer fewer styles, resulting in slightly slower load times but less of a chance for Cumulative Layout Shifts to occur. If you are experiencing CLS issues you can increase the threshold height.' => 'Amikor a Critical CSS engedélyezve van, a Divi meghatároz egy "above the fold threshold" értéket, és a hajtás alatti elemek stílusait késlelteti. Ez a küszöb azonban csak becslés, és eszközönként eltérhet. A küszöb magasságának növelése kevesebb stílus késleltetését eredményezi, ami kissé lassabb betöltési időt jelenthet, de kisebb az esélye a Cumulative Layout Shifts (CLS) előfordulásának. Ha CLS-problémákat tapasztal, növelheti a küszöb magasságát.',
	'When a minimum height is set, the element will always have a height of at least the amount defined. This supersedes smaller static height values. Unlike height, minimum height does not result in content overflow and will allow the height of your element to remain dynamic.' => 'Ha minimális magasság van beállítva, az elem magassága mindig legalább a megadott érték lesz. Ez felülírja a kisebb statikus magasságértékeket. A magassággal ellentétben a minimális magasság nem eredményez tartalomtúlcsordulást, és lehetővé teszi, hogy az elem magassága dinamikus maradjon.',
	'When a visitor clicks into an input field, it becomes focused. You can pick a color to be used for the input field background while focused.' => 'Amikor egy látogató egy beviteli mezőre kattint, az fókuszba kerül. Kiválaszthat egy színt, amely fókuszban a beviteli mező háttereként lesz használva.',
	'When a visitor clicks into an input field, it becomes focused. You can pick a color to be used for the input text while focused.' => 'Amikor egy látogató egy beviteli mezőre kattint, az fókuszba kerül. Kiválaszthat egy színt, amely fókuszban a beviteli szöveghez lesz használva.',
	'When clicked the module will link to this URL.' => 'Kattintáskor a modul erre az URL-re mutat.',
	'When enabled, a background color is added behind the slider text to make it more readable atop background images.' => 'Ha engedélyezve van, a csúszka szövege mögé háttérszín kerül, hogy a háttérképeken olvashatóbb legyen.',
	'When enabled, a custom overlay color will be added above your background image and behind your slider content.' => 'Ha engedélyezve van, egyéni átfedő szín kerül a háttérkép fölé és a csúszka tartalma mögé.',
	'When enabled, this will add a custom icon within the button.' => 'Ha engedélyezve van, ez egyéni ikont ad a gombhoz.',
	'When enabled, this will force your image to extend 100% of the width of the column it\'s in.' => 'Ha engedélyezve van, ez kikényszeríti, hogy a kép az oszlop teljes, 100%-os szélességét kitöltse, amelyben található.',
	'When possible, jQuery and jQuery Migrate will be moved to the body to speed up load times. If a third party plugin registers jQuery as a dependency, it will be moved back to the head.' => 'Amikor lehetséges, a jQuery és a jQuery Migrate a body-ba kerül, hogy gyorsítsa a betöltést. Ha egy külső bővítmény függőségként regisztrálja a jQueryt, visszakerül a head-be.',
	'When the value above is found within your desired area, it will be replaced with the value that you choose here.' => 'Amikor a fenti érték megtalálható a kívánt területen, lecserélésre kerül az itt választott értékre.',
	'When this option is enabled, the builder\'s inline CSS styles for all pages will be cached and served as static files. Enabling this option can help improve performance.' => 'Ha ez az opció engedélyezve van, az összes oldalra vonatkozóan a builder inline CSS stílusai gyorsítótárba kerülnek és statikus fájlokként lesznek kiszolgálva. Ennek engedélyezése javíthatja a teljesítményt.',
	'When this option is enabled, the builder\'s inline CSS styles for this page will be cached and served as a static file. Enabling this option can help improve performance.' => 'Ha ez az opció engedélyezve van, ennél az oldalnál a builder inline CSS stílusai gyorsítótárba kerülnek és statikus fájlként lesznek kiszolgálva. Ennek engedélyezése javíthatja a teljesítményt.',
	'When you are all done, you can save your changes by clicking the %1$s button inside of your page settings bar. You can also press Ctrl + S at any time to save your changes. Click the highlighted Save button to save your changes. Don’t worry, the page you were working on before starting this tour will not be lost!' => 'Ha végzett, az oldalbeállítások sávjában található %1$s gombra kattintva mentheti a módosításokat. Bármikor megnyomhatja a Ctrl + S billentyűket is a mentéshez. Kattintson a kiemelt Save gombra a változtatások mentéséhez. Ne aggódjon, a túra megkezdése előtt szerkesztett oldal nem vész el!',
	'When you define your keywords using custom fields you should use this value for the custom field Name. The Value of your custom field should be the meta keywords you would like to use, separated by comas.' => 'Amikor kulcsszavait egyéni mezőkkel adja meg, ezt az értéket használja az egyéni mező Name mezőjéhez. Az egyéni mező Value értéke a használni kívánt meta keywords legyen, vesszőkkel elválasztva.',
	'When you define your meta description using custom fields you should use this value for the custom field Name. The Value of your custom field should be the custom description you would like to use.' => 'Amikor a meta leírást egyéni mezőkkel adja meg, ezt az értéket használja az egyéni mező Name mezőjéhez. Az egyéni mező Value értéke a használni kívánt egyéni leírás legyen.',
	'When you define your title using custom fields you should use this value for the custom field Name. The Value of your custom field should be the custom title you would like to use.' => 'Amikor a címet egyéni mezőkkel adja meg, ezt az értéket használja az egyéni mező Name mezőjéhez. Az egyéni mező Value értéke a használni kívánt egyéni cím legyen.',
	'When you save layouts to Divi Cloud, they become available on every website you build.' => 'Amikor elrendezéseket ment a Divi Cloudba, azok minden elkészített webhelyen elérhetővé válnak.',
	'When you sync %s to Divi Cloud, they become available on every website you build.' => 'Amikor szinkronizálja a(z) %s-t a Divi Cloudba, azok minden elkészített webhelyen elérhetővé válnak.',
	'Whenever you hover over a Section, Row or Module in the Divi Builder, action buttons will appear. These buttons can be used to move, modify, duplicate or delete your content. Click the highlighted “duplicate” icon to duplicate the blurb module that you just added to the page.' => 'Amikor a Divi Builderben egy Section, Row vagy Module fölé viszi az egeret, műveletgombok jelennek meg. Ezekkel a gombokkal mozgathatja, módosíthatja, duplikálhatja vagy törölheti a tartalmat. Kattintson a kiemelt „duplicate” ikonra, hogy duplikálja az imént az oldalhoz adott blurb modult.',
	'Whenever you make changes in the Divi Builder, these changes can be Undone, Redone, Discarded or Accepted. Now that you have adjusted your module’s title, you can click the red discard button to cancel these changes, or your can click the green button to accept them.' => 'Amikor módosításokat végez a Divi Builderben, ezek a változtatások Visszavonhatók, Újra végrehajthatók, Elvethetők vagy Elfogadhatók. Miután módosította a modul címét, kattinthat a piros discard gombra a módosítások elvetéséhez, vagy a zöld gombra azok elfogadásához.',
