	'Whether or not to use a single Name field in the opt-in form.' => 'Használjon-e egyetlen Name mezőt a feliratkozó űrlapon.',
	'Whether to exclude the current post from results (used when query_type is post_type, except for attachments)' => 'Kizárja-e az aktuális bejegyzést az eredményekből (akkor használatos, ha a query_type post_type, a mellékletek kivételével)',
