	'While Divi 5 was built to be backward compatible, the backward compatibility system is in its alpha stage. Some creators don\'t want to participate in the testing phase.' => 'Bár a Divi 5 visszafelé kompatibilisnek készült, a visszafelé kompatibilitási rendszer még alfa fázisban van. Néhány készítő nem szeretne részt venni a tesztelési fázisban.',
	'While creating your site, something got hung up. Click Retry to resume where things left off, or Cancel to restore your site to its previous state.' => 'A webhely készítése közben valami elakadt. Kattintson a Retry gombra a folytatáshoz onnan, ahol abbamaradt, vagy a Cancel gombra, hogy visszaállítsa webhelyét az előző állapotára.',
