	'You cannot save layout while a split test is running. Please end your split test and then try again.' => 'Nem menthet elrendezést, amíg A/B teszt fut. Kérjük, fejezze be az A/B tesztet, majd próbálja meg újra.',
	'You cannot save the layout right now because you have incomplete split test configuration. Please finish the split test configuration first, then try save draft again.' => 'Most nem mentheti az elrendezést, mert az A/B teszt beállítása hiányos. Kérjük, fejezze be először az A/B teszt beállítását, majd próbálja meg újra a piszkozat mentését.',
	'You cannot save this module while a split test is running. Please end your split test and then try again.' => 'Nem mentheti ezt a modult, amíg A/B teszt fut. Kérjük, fejezze be az A/B tesztet, majd próbálja meg újra.',
	'You cannot save this row while a split test is running. Please end your split test and then try again.' => 'Nem mentheti ezt a sort, amíg A/B teszt fut. Kérjük, fejezze be az A/B tesztet, majd próbálja meg újra.',
